CREATE PROCEDURE [dbo].[CreatePracticeScale]
	@HoganFieldId int,
	@CatId int,
	@LevelId int,	
	@ProgramId int,
	@Lower int,
	@Upper int
	
AS

Declare @FriendlyName nvarchar(30) Declare @ResxId int Declare @NewPracticeTextId int Set @FriendlyName = SubString(@Text,0,30);
Begin
exec @ResxId = dbo.CreateResx N'PracticeText_Text',@FriendlyName,@Culture,@Text Insert into PracticeText (TextResxId,ParentPracticeTextId) values(@ResxId,@PracticeTextId); set @NewPracticeTextId = @@IDENTITY End RETURN @NewPracticeTextId

